import React from "react";
import Toper2 from './Toper2';
const SpinnerPage = () => {
  this.props.history.push({pathname : `/loading`});
  
  return (
    <>
       <Toper2/>
      <br/>
      <br/> 
      <br/>
      <br/>       
      <div class="spinner-border fast" role="status">
        <span class="sr-only">Loading...</span>
      </div>
    </>
  );
}

export default SpinnerPage;
